import { Button } from 'react-bootstrap';
import history from './history';
import './App.css';

function About() {
  return (
          <div className="container About-body">   
                         <div data-content-for="xl">
                             <p style={{ fontSize: "36px", }} data-mce-style={{ fontSize: "36px", lineHeight: "3rem"}}>
                                <span className="font_rut3oe4qq">&nbsp;The core of my work is to set long term vision and strategy for products. </span>
                            </p>
                            <p style={{ fontSize: "18px"}} data-mce-style={{ fontSize: "18px", lineHeight: "3rem"}}>
                                <span className="font_rut3oe4qq">&nbsp; I‘m currrently spending my days  building a viable product for Egwu records. I have contributed to <br />various projects and executed  initiatives on both in-house and I have also worked as an individual <br />consultant  where I was given the opportunity to develop my knowledge in product management.</span>
                            </p>
                            <p style={{ fontSize: "2.94444rem", }} data-mce-style={{ fontSize: "2.94444rem", lineHeight: "3rem"}}>
                                <span className="font_rut3oe4qq">&nbsp;A Product Manager — </span><span className="font_rut3oe4qq">passionate  about technology, <a href='https://vsco.co/maryfisher/gallery' style={{Color: "red"}}><u>photography,</u></a> art and how they shape our human experienceand growth, delivering value, finding problems and validating solutions. .</span>
                            </p>
                            <p style={{ fontSize: "2.94444rem", }} data-mce-style={{ fontSize: "2.94444rem", lineHeight: "3rem"}}>
                                <span className="font_rut3oe4qq">&nbsp;A Product Manager — </span><span className="font_rut3oe4qq">passionate  about technology, <a href='https://vsco.co/maryfisher/gallery' style={{Color: "red"}}><u>photography,</u></a> art and how they shape our human experienceand growth, delivering value, finding problems and validating solutions. .</span>
                            </p>
                            <p style={{ fontSize: "2.94444rem", }} data-mce-style={{ fontSize: "2.94444rem", lineHeight: "3rem"}}>
                                <span className="font_rut3oe4qq">&nbsp;A Product Manager — </span><span className="font_rut3oe4qq">passionate  about technology, <a href='https://vsco.co/maryfisher/gallery' style={{Color: "red"}}><u>photography,</u></a> art and how they shape our human experienceand growth, delivering value, finding problems and validating solutions. .</span>
                            </p>
                         </div>

                </div>
  );
}

export default About;
